sidebarCSS:
@media screen and (max-width: 41px) {
 * {
   --tabs-indent: 0px;
 }
 .Tab[data-pin="false"] .audio {
   top: 4px;
   left: 8px;
 }
 #root .Tab[data-pin="false"]:not([data-lvl="0"]) .body:after {
  height: 0px;
  width: 0px;
 }
}

#root {
  --tabs-font: 10pt FantasqueSansM Nerd Font;
  --tabs-count-font: .625rem FantasqueSansM Nerd Font;
  --bookmarks-bookmark-font: .875rem FantasqueSansM Nerd Font;
  --bookmarks-folder-font: 10pt FantasqueSansM Nerd Font;
  --tabs-height: 43px;
}

.Tab {
  margin: 0 4px;
  width: unset;
}

/* Resize and reposition favicons */
.Tab .fav {
  width: 20px;
  height: 20px;
  margin-left: 10px;
}

.Tab .placeholder > svg {
  width: 20px;
  height: 20px;
}

.Tab .fav,
.Tab .placeholder,
.Tab .t-box {
  margin-bottom: -2px;
}

